import TshirtData from "./TshirtData"

const Tshirt = (props) =>{
  return(
    <div>
      {props.data.map((item)=>{
        <div>
          <li key={item.id}>
            <TshirtData
              name={item.name}
              description={item.description}
              price={item.price}
            />
          </li>
        </div>

      })}
    </div>
  )
}
export default Tshirt
